import { Box, Grid, InputBase, Stack, Typography } from '@mui/material';
import { fields1, fields2 } from './fileds';

function PersonalInformation() {
  return (
    <Box sx={{ backgroundColor: '#fff', padding: '10px' }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <Typography
          variant="h5"
          gutterBottom
          sx={{
            fontFamily: 'SVN-Sofia-Medium',
            fontWeight: 500,
            fontSize: '20px',
            margin: 0,
          }}
        >
          Personal Information
        </Typography>
        <Typography
          variant="body2"
          gutterBottom
          sx={{
            fontFamily: 'SVN-Sofia-Medium',
            color: 'rgb(104, 112, 118)',
            display: 'flex',
            alignItems: 'center',
            margin: 0,
          }}
        >
          Required &nbsp;(
          <Typography variant="body1" gutterBottom sx={{ fontSize: '16px', color: 'rgb(229, 72, 77)', margin: 0 }}>
            *
          </Typography>
          )
        </Typography>
      </Box>
      <hr
        style={{
          margin: '10px 0',
          borderWidth: '0px 0px thin',
          borderColor: 'rgba(193, 200, 205, 0.24)',
          borderStyle: 'solid',
        }}
      />
      <form>
        <Box sx={{ display: 'flex', flexWrap: 'wrap' }}>
          <Stack
            direction="column"
            spacing={2}
            sx={{ flex: '1 1 0%', paddingLeft: '20px', paddingRight: '20px', gap: '10px' }}
          >
            {fields1.map((item: any, index: number) => (
              <Grid container spacing={2} key={index} sx={{ '&>div:first-child': { marginLeft: '0' } }}>
                <Grid xs={5}>
                  <Typography
                    variant="body2"
                    gutterBottom
                    sx={{
                      fontFamily: 'SVN-Sofia-Regular',
                      display: 'flex',
                      alignItems: 'center',
                      margin: 0,
                      fontSize: '16px',
                    }}
                  >
                    {item.field}
                    <Typography variant="body1" gutterBottom sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}>
                      {item.required}
                    </Typography>
                  </Typography>
                </Grid>
                <Grid xs={7}>{item.input}</Grid>
              </Grid>
            ))}
          </Stack>
          <Stack
            direction="column"
            spacing={2}
            sx={{ flex: '1 1 0%', paddingLeft: '20px', paddingRight: '20px', gap: '10px' }}
          >
            {fields2.map((item: any, index: number) => (
              <Grid container spacing={2} key={index}>
                <Grid xs={5}>
                  <Typography
                    variant="body2"
                    gutterBottom
                    sx={{
                      fontFamily: 'SVN-Sofia-Regular',
                      display: 'flex',
                      alignItems: 'center',
                      margin: 0,
                      fontSize: '16px',
                    }}
                  >
                    {item.field}
                    <Typography variant="body1" gutterBottom sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}>
                      {item.required}
                    </Typography>
                  </Typography>
                </Grid>
                <Grid xs={7}>{item.input}</Grid>
              </Grid>
            ))}
          </Stack>
        </Box>
      </form>
    </Box>
  );
}

export default PersonalInformation;
